import React, { useEffect } from "react";
import PropTypes from 'prop-types';
import './SignIn.css';
import Button, { ButtonProps }  from '@mui/material/Button';
import Axios from 'axios';
import { useState }  from 'react';






export default function SignUp({ setToken }) {
  const [printAll , setprintAll]=useState([]);
  const [firstName, setFirstName] = useState();
  const [lastName, setLastName] = useState();
  const [cnuID, setcnuID] = useState();
  const [phone, setPhone] = useState();
  const [email, setEmail] = useState();
  const [address, setAddress] = useState();
  const [EmergencyContactName, setEmergencyContactName] = useState();
  const [EmergencyContactRelationship, setEmergencyContactRelationship] = useState();
  const [EmergencyContactPhoneNumber, setEmergencyContactPhoneNumber] = useState();
  const [password, setPassword]=useState("");

useEffect(()=>{
  Axios.get('http://localhost:3001/api/get').then((response)=>{
    setprintAll(response.data)
  })
},[])
const register=async(e)=>{
  e.preventDefault();
  try{
    await    Axios.get('http://localhost:3001/api/insert',{
          cnuID:cnuID,
          firstName:firstName,
          lastName:"lastName",
          phone:phone,
          address:address,
          email:email,
          EmConName:EmergencyContactName,
          EmConPhone:EmergencyContactPhoneNumber,
          EmConRelation:EmergencyContactRelationship,
          password:password
      }).then((response)=>{
        alert("SUCCESSFUL INSERT SO SMART "+firstName)
      });
  }
  catch(err){
    alert(err)
  }
};
// const register =()=>{
//   console.log("REGISTER WAS CALLED");
//   Axios.post('http://localhost:3001/api/insert',{
//     cnuID:cnuID,
//     firstName:firstName,
//     lastName:"lastName",
//     phone:phone,
//     address:address,
//     email:email,
//     EmConName:EmergencyContactName,
//     EmConPhone:EmergencyContactPhoneNumber,
//     EmConRelation:EmergencyContactRelationship,
//     password:password
// }).then((response)=>{
//   alert("SUCCESSFUL INSERT SO SMART")
// });
  
// };

  return(
    <div className="login-wrapper">
      <h1>Please Log In</h1>
      <form >
        <label >
          <p className='firstName'>First Name</p>
          <input type="text" onChange={(e) => setFirstName(e.target.value)} />

        </label>
        <label>
          <p className='lastName'>Last Name</p>
          <input type="lastName" onChange={(e) => setLastName(e.target.value)} />
        </label>
        <label>
          <p className='cnuID'>CNU ID</p>
          <input type="cnuID" onChange={(e) => setcnuID(e.target.value)} />
        </label>
        <label>
          <p className='phone'>Phone</p>
          <input type="phone" onChange={(e) => setPhone(e.target.value)} />
        </label>
        <label>
          <p className='email'>CNU Email</p>
          <input type="email" onChange={(e) => setEmail(e.target.value)} />
        </label>
        <label>
          <p className='lastName'>Password</p>
          <input type="password" onChange={(e) => setPassword(e.target.value)} />
        </label>
        <label>
          <p className='address'>Address (While at school)</p>
          <input type="address" onChange={(e) => setAddress(e.target.value)} />
        </label>
        <label>
          <p className='EmergencyContactName'>Emergency Contact Name</p>
          <input type="EmergencyContactName" onChange={(e) => setEmergencyContactName(e.target.value)} />
        </label>
        <label>
          <p className='EmergencyContactRelationship'>Emergency Contact Relationship</p>
          <input type="EmergencyContactRelationship" onChange={(e) => setEmergencyContactRelationship(e.target.value)} />
        </label>
        <label>
          <p className='EmergencyContactPhoneNumber'>Emergency Contact Phone Number</p>
          <input type="EmergencyContactPhoneNumber" onChange={(e) => setEmergencyContactPhoneNumber(e.target.value)} />
        </label>

        <div  >
            </div>
                  <Button 
                  onClick={register}                                                                         
            
                  style={{
                    color:"#fff",
                    width:"250px",
                    borderColor: 'white',
                    backgroundColor: "#5286db",
                    // padding: "8px 26px",
                    fontSize: "18px",
                    marginTop: "20px"
                  
                }}
                  >Create an Account</Button>
                  {printAll.map((val)=>{
          return <h1>PEEPS: {val.firstName} | {val.lastName}</h1>
        })}

          
        

      </form>
    </div>
  )
}

SignUp.propTypes = {
  setToken: PropTypes.func.isRequired
};
